import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import QuoteCards from './components/QuoteCard';
import nelsonMuntz from  './components/QuoteCard';

function App() {
  return (
    <div className="App">
    <Navbar />
    <QuoteCards     blockquote = 'Shoplifting is a victimless crime, like punching someone in the dark.'
        cite = "Nelson Muntz"/>
    <QuoteCards     blockquote = 'Shoplifting ilike punching someone in the dark.'
        cite = "Nelsntz" />
    </div>
  );
}


export default App;
